import React from "react";
import Cookie from "cookie-universal";

const Logout = () => {
  const cookie = Cookie();

  const handelDelete = () => {
    cookie.remove("Bearer");
  };
  return <button onClick={() => handelDelete}>Logout</button>;
};

export default Logout;
